import React from "react";

function TaskTable({ tasks, deadline, onEdit }) {
  return (
    <div className="container mt-5">
      <table className="table">
        <thead className="thead-dark">
          <tr>
            <th>Title</th>
            <th>Description</th>
            <th>Deadline</th>
            <th>Priority</th>
            <th>Is Complete</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {tasks.map((task) => (
            <tr key={task.id}>
              <td>{task.title}</td>
              <td>{task.description}</td>
              <td>{deadline}</td> {/* Display the deadline here */}
              <td>{task.priority}</td>
              <td>
                <input
                  type="checkbox"
                  checked={task.isComplete}
                  onChange={() => {
                    // Handle change
                  }}
                />
              </td>
              <td>
                <button onClick={() => onEdit(task)}>Edit</button>
                {/* Add Delete button if necessary */}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TaskTable;
